(1, 'Giảm giá 120 triệu đồng, Honda CR-V vẫn kén khách', 'giam-gia-120-trieu-dong-honda-cr-v-van-ken-khach', '/storage/post/1624272201.jpg', '<p><div class=\"__MASTERCMS_CONTENT fw lt mb clearfix\" style=\"margin: 0px 0px 15px; padding: 0px; box-sizing: border-box; width: 815px; display: block; float: left; color: rgb(51, 51, 51); font-family: Arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\"></div></p><div class=\"article-detail-desc f3\" style=\"margin: 0px 0px 15px; padding: 0px; box-sizing: border-box; font-family: Roboto-Bold, sans-serif; font-weight: 700; font-size: 16px; color: rgb(51, 51, 51); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\">Giảm giá 120 triệu đồng, nhưng doanh số Honda CR-V thế hệ mới vẫn chưa đạt được như kì vọng.</div><div class=\"article-detail-desc f3\" style=\"margin: 0px 0px 15px; padding: 0px; box-sizing: border-box; font-family: Roboto-Bold, sans-serif; font-weight: 700; font-size: 16px; color: rgb(51, 51, 51); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\"><img src=\"data:image/jpeg;base64,\" style=\"width: 645px;\" data-filename=\"5405_Honda_CR-V_2021.jpg\"><br></div><div class=\"article-detail-desc f3\" style=\"margin: 0px 0px 15px; padding: 0px; box-sizing: border-box; font-family: Roboto-Bold, sans-serif; font-weight: 700; font-size: 16px; color: rgb(51, 51, 51); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\"><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; line-height: 1.4; font-family: Arial, sans-serif; font-weight: 400; text-align: justify;\">Nhiều đại lý đang chào bán mẫu xe Honda CR-V theo kiểu dọn kho, giảm giá. Mỗi nơi có một chính sách giá khác nhau nhưng mức giảm cao nhất ghi nhận được là khoảng 120 triệu đồng tiền mặt kèm gói phụ kiện giá hàng chục triệu đồng nữa.</p><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; line-height: 1.4; font-family: Arial, sans-serif; font-weight: 400; text-align: justify;\">Theo đó, giá xe Honda CR-V 2021 đang được giảm tới 100 triệu đồng đối với cả 2 phiên bản G và L tại nhiều đại lý ở Hà Nội. Trong khi đó, đối với bản Honda CR-V 2020, khách hàng được nhận ưu đãi lớn hơn với 120 triệu đồng, tuy nhiên số lượng xe tại đại lý không còn nhiều nên khách hàng không có nhiều sự lựa chọn về màu sắc.</p><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; line-height: 1.4; font-family: Arial, sans-serif; font-weight: 400; text-align: justify;\">Tại TP. HCM, một tư vấn bán hàng chia sẻ rằng thể do ảnh hưởng của dịch Covid-19, khách hàng ngại mua xe nên hãng và đại lý giảm sâu hơn để kích cầu. Hiện cả 3 phiên bản Honda CR-V 2021 tại đây đang có mức giảm tiền mặt 90 triệu đồng.</p><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; line-height: 1.4; font-family: Arial, sans-serif; font-weight: 400; text-align: justify;\">Thậm chí mức giảm lớn của Honda CR-V đã trở thành tâm điểm của thị trường trong suốt khoảng thời gian vừa qua nhưng thực tế doanh số bán hàng lại gần như không tăng được bao nhiêu. Có thể khi triển khai kế hoạch đại hạ giá này Honda đã hướng đến mục tiêu cạnh tranh với Mazda CX-5 nhưng nếu sự thật là như vậy thì quả thực Honda đã hoàn toàn thất bại trong chiến lược này.</p><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; line-height: 1.4; font-family: Arial, sans-serif; font-weight: 400; text-align: justify;\"><span style=\"margin: 0px; padding: 0px;\">Theo số lượng thống kê từ Hiệp hội các nhà sản xuất ô tô Việt Nam kết thúc tháng 5/2021 mẫu xe Honda CR-V chỉ đạt 421 xe, cộng dồn từ đầu năm đến nay có 2.221 xe được giao đến tay khách hàng. Trong đó đối thủ Mazda CX-5 với 679 xe được giao đến tay khách hàng, tính đến hết tháng 5 đã có 4.164 xe bán ra, nhiều hơn đối thủ CR-V gần 2.000 xe. Rõ ràng dù Mazda không dùng chiến lược đại hạ giá nhưng kết quả từ những kế hoạch bán hàng của mẫu xe này đã đạt hiệu quả hơn hẳn.</span></p><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; line-height: 1.4; font-family: Arial, sans-serif; font-weight: 400; text-align: justify;\">Trước đó, trong năm 2020, CR-V để CX-5 vươn lên giành lại vị trí đầu bảng với doanh số 11.803 xe, nhiều hơn CR-V 438 xe. Mazda CX-5 đứng ở vị trí thứ 8 trong top 10 xe bán chạy nhất, còn Honda CR-V đứng ở vị trí thứ 10 trong bảng xếp hạng.</p><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; line-height: 1.4; font-family: Arial, sans-serif; font-weight: 400; text-align: justify;\">Hiện Honda CR-V là một trong những mẫu SUV chủ lực của Honda trên thị trường thế giới, tuy nhiên, tại Việt Nam có phần đuối hơi so với đối thủ chủ đạo là Mazda CX-5. Có thể lý do nằm ở giá bán niêm yết của Honda CR-V vốn đã ở mức quá “ngất ngưởng” so với phân khúc này tại Việt Nam nên dù đại hạ giá vẫn là một mức giá không thể cạnh tranh so với Mazda CX-5, nền tảng cũng là một yếu tố quan trọng khi triển khai các kế hoạch thu hút khách hàng phải không nào.</p><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; line-height: 1.4; font-family: Arial, sans-serif; font-weight: 400; text-align: justify;\">Bên cạnh đó, dịch Covid-19 với diễn biến khá phức tạp, buộc các hãng xe Nhật Bản và đại lý phải đẩy mạnh các chương trình ưu đãi, giảm giá. Tuy nhiên, lượng khách mua xe tại đại lý khá vắng vẻ.</p><p style=\"margin-right: 0px; margin-bottom: 15px; margin-left: 0px; padding: 0px; line-height: 1.4; font-family: Arial, sans-serif; font-weight: 400; text-align: justify;\">Theo giới kinh doanh ôtô, động thái giảm giá mạnh cho CR-V giúp Honda Việt Nam hoàn thành kế hoạch xả hàng tồn. Tuy nhiên, việc giảm giá sốc cũng tạo nên những mặt trái, ảnh hưởng đến uy tín của dòng xe này cũng như của hãng.</p></div>', 1, 1, '2021-06-21 03:43:21', '2021-06-21 03:43:21', '2021-06-21 03:43:21');
